import Vue from 'vue';
import Router from 'vue-router';
import AppHeader from '../layout/AppHeader';
import HelloWorld from '../views/HelloWorld.vue';

Vue.use(Router);

export default new Router({
  linkExactActiveClass: 'active',
  routes: [
    {
      path: '/',
      name: 'helloworld',
      component: {
        header: AppHeader,
        default: HelloWorld
      }
    }
  ],
  scrollBehavior: to => {
    if (to.hash) {
      return { selector: to.hash };
    } else {
      return { x: 0, y: 0 };
    }
  }
});
